style.css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

toolbox {
  -moz-appearance: none !important;
  background-color: #0C2032 !important;
  color: white !important;
}

sidebarheader,
#organizerScopeBar {
  -moz-appearance: none !important;
  background-color: rgb(34,105,126) !important;
  background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAeCAYAAADtlXTHAAAABGdBTUEAALGPC/xhBQAAABh0RVh0U29mdHdhcmUAUGFpbnQuTkVUIHYzLjIyt5EXfQAAACZJREFUGFdj+P//vwPDv3//HEGEEwOYi0aAZbFJYKqzA6ljoJgAACC0XZ3ZDZeDAAAAAElFTkSuQmCC) !important;
  background-repeat: repeat-x !important;
  color: white !important;
  border: none !important;
}

toolbox,
toolbar {
  border-width: 0 !important;
}

#main-window toolbox > toolbar[id="toolbar-menubar"] {
  -moz-appearance: none !important;
  background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAmCAYAAAAFvPEHAAAABGdBTUEAALGPC/xhBQAAABh0RVh0U29mdHdhcmUAUGFpbnQuTkVUIHYzLjIyt5EXfQAAACpJREFUGFdj+P//vwPDv3//HEGEEwOM6wxhIQiwEjQxIrhAbXYgbQw0IQAPN3aF3qi8MAAAAABJRU5ErkJggg==) !important;
}

#navigation-toolbar {
  -moz-appearance: none !important;
  background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAmCAYAAAAFvPEHAAAABGdBTUEAALGPC/xhBQAAABh0RVh0U29mdHdhcmUAUGFpbnQuTkVUIHYzLjIyt5EXfQAAACpJREFUGFdj+P//vwPDv3//HEGEEwOM6wxhIQiwEjQxIrhAbXYgbQw0IQAPN3aF3qi8MAAAAABJRU5ErkJggg==) !important;
  background-repeat: repeat-x;
  border-top: 0px solid transparent !important;
  border-bottom: 0px solid transparent !important;
  -moz-border-top-colors: transparent !important;
  -moz-border-bottom-colors: transparent !important;
}

#placesToolbar {
  -moz-appearance: none !important;
  background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAeCAYAAADtlXTHAAAABGdBTUEAALGPC/xhBQAAABh0RVh0U29mdHdhcmUAUGFpbnQuTkVUIHYzLjIyt5EXfQAAACZJREFUGFdj+P//vwPDv3//HEGEEwOYi0aAZbFJYKqzA6ljoJgAACC0XZ3ZDZeDAAAAAElFTkSuQmCC) !important;
  background-repeat: repeat-x;
  height: 32px !important;
  color: white !important;
}

#personal-toolbar {
  -moz-appearance: none !important;
  background-color: transparent !important;
  border: none !important;
}

toolbar .toolbarbutton-text,
#content .tab-text,
.menubar-text {
  color: white !important;
}

#content .tabs-container {
  -moz-appearance: none !important;
  background-color: #0C2032 !important;
}

#content tab[selected="true"] .tab-text {
  color: black !important;
}

#searchFilter,
#urlbar,
.searchbar-textbox {
  background-color: rgba(188,204,226,0.9) !important;
  -moz-appearance: none !important;
  border: none !important;
}

.searchbar-engine-button,
#identity-box {
  background-color: transparent !important;
  -moz-appearance: none !important;
  border: none !important;
  margin: 1px 0px 1px 0px !important;
  outline: none !important;
}

.searchbar-textbox:hover,
.searchbar-textbox[focused="true"],
#urlbar:hover,
#urlbar[focused="true"],
#searchFilter:hover,
#searchFilter[focused="true"] {
  background-color: rgb(188,204,226) !important;
}

/* Fix menu icons for CuteMenus */
.menu-iconic-left {
  min-width: 28px !important;
}

#searchModifiers {
  background-color: rgb(236,236,236) !important;
  border-bottom: 1px solid black !important;
  padding-right: 0px !important;
  -moz-margin-end: 0px !important;
}

#organizerScopeBar toolbarbutton[checked="true"] {
  -moz-appearance: none !important;
  background-color: white !important;
  background-image: none !important;
  -moz-border-radius: 3px !important;
}

#organizerScopeBar toolbarbutton[checked="true"] .toolbarbutton-text {
  color: black !important;
}

#organizerScopeBar label,
#organizerScopeBar .toolbarbutton-text {
  color: white;
}

#advancedSearch[collapsed="true"] + #searchActions {
  display: none !important;
}

#placesView tree,
#infoPane,
#bookmarks-view,
#historyTree {
  background-color: rgb(238,243,250) !important;
}

#splitter,
#contentSplitter,
#sidebar-splitter {
  width: 2px !important;
  height: 2px !important;
  min-width: 1px !important;
  min-height: 1px !important;
  background-color: rgb(193,209,227) !important;


  border: none !important;
}

#contentSplitter grippy,
#splitter grippy {
  visibility: hidden !important;
}

#organizeButton {
  list-style-image: url(data:image/png;base64,) !important;
}

#viewMenu {
  list-style-image: url(data:image/png;base64,) !important;
}
#maintenanceButton {
  list-style-image: url(data:image/png;base64,) !important;
}

.textbox-input-closebutton,
.search-go-button {
  list-style-image: url(data:image/png;base64,) !important;
}

.textbox-input-closebutton,
.search-go-button {
  -moz-image-region: rect(0px,78px,20px,52px) !important;
  display: -moz-box !important;
  height: 20px !important;
  width: 26px !important;
  margin: 0px !important;
  padding: 0px !important;
}

#searchFilter[filtered="true"] .textbox-input-closebutton {
  -moz-image-region: rect(0px,104px,20px,78px) !important;
}

#searchFilter[filtered="true"] .textbox-input-closebutton:hover {
  -moz-image-region: rect(20px,52px,40px,26px) !important;
}

#searchFilter[filtered="true"] .textbox-input-closebutton:hover:active {
  -moz-image-region: rect(40px,52px,60px,26px) !important;
}
